// Longest Substring Without Repeating Characters

#include <iostream>
#include <string>
#include <map>
using namespace std;

class Solution {
public:
    int lengthOfLongestSubstring(string s) {
        map<char,int> existMap;
        string curStr = "";
        int i = 0, maxlen = 0;
        while(i < s.length()){
            if (existMap.find(s[i]) != existMap.end()) {
                if (existMap.size() > maxlen) {
                    maxlen = existMap.size();
                }
                // 移除上次本字符出现的位置及其前面的字符
                int j = 0;
                while(j < curStr.length()) {
                    existMap.erase(curStr[j]);
                    if (curStr[j] == s[i]) break;
                    j++;
                }
                if (j < curStr.length()) {
                    curStr = curStr.substr(j+1,curStr.length()-j-1);
                } else {
                    curStr = "";
                }
            }
            existMap[s[i]] = 1;
            curStr += s[i];
            i++;
        }
        if (existMap.size() > maxlen) maxlen = existMap.size();
        return maxlen;
    }
};

